string getSymbol(int t)
{
	if (t == 19999) return"#";
	if (t == 29999) return "S'";
	if (t == 39999) return "epsilon";
	for (auto& p : symTable)
		if (p.second == t) return p.first;
	return "";
}

void printMTree(string prefix, TreeNode Node, bool isFirst)
{
	if (Node != NULL) {
		treefile << prefix;
		treefile << (isFirst ? "├─ " : "└─ ");
		treefile << Node->name << endl;
		// enter the next tree level - left and right branch
		for (int i = 0; i < Node->child.size(); i++)
			printMTree(prefix + (isFirst ? "│			" : " 			"), Node->child[i], i == 0);
	}
}
